function eliminarServicioFunction (element) {

  let servicioDialog = eliminarServicioDialog

  const dialog = document.createElement("dialog")

  dialog.setAttribute("id", "popupServicio")

  dialog.setAttribute("open", "true")

  dialog.innerHTML = servicioDialog

  document.body.appendChild(dialog)

  document.getElementById("dialog-confirmar-button").addEventListener('click', () => {
      
    document.body.removeChild(dialog)
    
    element.parentNode.remove()
    
  })

  document.getElementById("dialog-cancelar-button").addEventListener('click', () => {
      
    document.body.removeChild(dialog)
    
  })

}

eliminarServicio.forEach((element) => {

  eliminar = () => {eliminarServicioFunction(element.parentNode)}
  
  element.addEventListener("click", eliminar)

})

nuevoServicioForm.addEventListener("submit", (e) => {
  
  e.preventDefault()
  
  let dataServicio = new FormData(e.target)

  let ente =  document.getElementById("pagos-ente")

  let enteText = ente.options[ente.selectedIndex].text

  let enteCod = dataServicio.get("pagosCod")
  
  let servicioDialog = nuevoServicioDialog

  let serviciosTable = document.getElementById("serviciosAdheridos-table")

  let servicioExistente = false

  for (let i=0, row; row = serviciosTable.rows[i]; i++) {

    if(row.cells[0].innerHTML == enteText) {      

      servicioExistente = true

      break
    
    }

  }

  if(!servicioExistente){

    const dialog = document.createElement("dialog")

    dialog.setAttribute("id", "popupServicio")

    dialog.setAttribute("open", "true")

    dialog.innerHTML = servicioDialog

    document.body.appendChild(dialog)

    document.getElementById("dialog-confirmar-button").addEventListener('click', () => {
      
      document.body.removeChild(dialog)

      nuevoServicioForm.reset()    

      var servicio = serviciosTable.insertRow(1);

      var nuevoEnte = servicio.insertCell(0)

      var nuevoCod = servicio.insertCell(1)

      var iconoEliminar = servicio.insertCell(2)

      nuevoEnte.setAttribute("class","thServicio")

      nuevoCod.setAttribute("class", "thCodigo")

      iconoEliminar.setAttribute("class", "col-eliminar-servicio")
    
      nuevoEnte.innerHTML = enteText

      nuevoCod.innerHTML = enteCod

      iconoEliminar.innerHTML = '<i class="bi bi-trash3 eliminar-servicio">'
  
      serviciosTable.rows[1].cells[2].addEventListener("click", () => {

        eliminarServicioFunction(serviciosTable.rows[1].cells[2])

      })
    
    })

    document.getElementById("dialog-cancelar-button").addEventListener('click', () => {
      
      document.body.removeChild(dialog)

      nuevoServicioForm.reset()
    
    })

  } else {

    servicioDialog = servicioExistenteDialog

    const dialog = document.createElement("dialog")

    dialog.setAttribute("id", "popupServicio")

    dialog.setAttribute("open", "true")

    dialog.innerHTML = servicioDialog

    document.body.appendChild(dialog)

    document.getElementById("dialog-confirmar-button").addEventListener('click', () => {
      
      document.body.removeChild(dialog)

      nuevoServicioForm.reset()
    
    })

  }


})

